  return(
    <>
    <Hero hero='roomsHero'>
      <Banner title='Our Rooms'>
        <Link to ='./Home' className='btn-primary'> Return Home </Link>
      </Banner>
    </Hero>
    <RoomContainer/>
    </>

  )
}
